window.bookSummaryJSON = "<p><b>\"Do-overs\" are possible.</b></p> <p>The hyperdimensional crystalline network allows reality to be reset to past moments in time....</p> <p>After a routine \"reset\" on her homeworld, Elle Hartmut instead awakens on a spaceship. Her body is different, she has new seemingly magical abilities, and sheâ€™s told that the fate of known civilization is in her hands.</p> <p>An alien Darkness is corrupting the Hegemony's worlds. Elle and a team of companions with enhanced abilities like her own embark on an interstellar quest to stop the advancing Darkness. The team's only clue is that fabled relics may hold the key to salvation.</p> <p>With their worlds already destroyed, the only hope is a \"universal reset\" to undo the damage. However, as legends become fact and the lines between magic and science blur, Elle and her friends must unravel ancient secrets before their worlds and loved ones are lost in shadow forever.</p> <p>The Dark Stars trilogy offers a unique blend of sci-fi and fantasy adventure with a sleek high-tech skin on traditional magic. With adventure, magic, and aliens, join Elle on her journey in a universe where second chances are real!</p> <p><b>Bundle of the complete Nebula Award-nominated Dark Stars trilogy:</b></p> <p></p> <ol> <li><i>Crystalline Space</i></li> <li><i>A Light in the Dark</i></li> <li><i>Masters of Fate</i></li> </ol>"; 
